import React from 'react';

function Feedback() {
  return (
    <div style={{ textAlign: 'center', padding: '50px', color: '#888' }}>
      <h2>Feedback</h2>
      <p>We value your input!</p>
      <p>This feedback form is coming soon.</p>
    </div>
  );
}

export default Feedback;
